/* eslint-disable import/prefer-default-export */
import axios from 'axios';
import moment from 'moment';
import * as API_END_POINTS from '../constants/api';
import * as types from '../constants/actionTypes';

const FileDownload = require('js-file-download');
// Action function for get user transaction function
export const userTransaction = id => {
  return dispatch => {
    axios
      .get(`${API_END_POINTS.SPACEX_ADDRESS}?user_id=${id}`, {
        headers: {
          Accept: 'application/json,',
        },
        withCredentials: true,
      })
      .then(response => {
        if (response && response.data) {
          dispatch({
            type: types.SPACEX_ADDRESS,
            addressData: response.data,
          });
        }
      })
      .catch(() => {
        // Handle Failed Request
      });
  };
};

// Action function for get user transaction function
export const adminLogin = (username, password) => {
  return dispatch => {
    axios
      .post(
        API_END_POINTS.SPACEX_HISTORY,
        { username, password },
        {
          headers: {
            Accept: 'application/json,',
            'Content-Type': 'application/json',
          },
          withCredentials: true,
        },
      )
      .then(response => {
        if (response && response.data) {
          dispatch({
            type: types.SPACEX_HISTORY,
            historyData: response.data,
          });
        }
      })
      .catch(error => {
        // Handle Failed Request
        dispatch({
          type: types.SNACK_BAR,
          snackBar: error && error.response && error.response.data && error.response.data.message,
          statusColor: 'error',
        });
      });
  };
};
